import React from 'react';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

class Connect extends React.Component {
  render() {
    return (
      <div className='connect text-center pt-5 pb-5'>
        <h1>Connect with me </h1>
        <span > 

            <a href='https://www.linkedin.com/in/fangting-chen-73114b1a0/' style={{color: '#232b2b'}} target="_blank">
                <FaLinkedin className='mr-2 ml-2' size={50}/> 
            </a>

            <a href='https://github.com/Finicft' style={{color: '#232b2b'}} target="_blank">
                <FaGithub className='mr-2 ml-2' size={50}/>
            </a>
        </span>
      </div>
    );

    }
}

export default Connect;
